import * as React from 'react';
import { AdvertiseMillionsCard } from '../functions/AdvertiseMillionsCard';

// Images
const howToStart = require('../../../../public/img/high/host-ready.jpg');

export const AdvertiseMillions = () => {
  return (
    <>
      <div className='w-full px-6 md:px-0 md:max-w-3xl lg:max-w-5.5xl mx-auto pt-8 pb-16'>
        <div className='flex flex-col items-center'>
          <div className='my-8'>
            <div
              style={{ width: 70, height: 2 }}
              className='bg-gray-650 rounded-lg'></div>
          </div>
          <div>
            <h3
              style={{ fontFamily: 'airbnb-bold' }}
              className='text-6xl tracking-tighter text-gray-750'>
              Advertise to millions
            </h3>
          </div>
        </div>
      </div>
      <div className='w-full md:max-w-3xl lg:max-w-5.5xl mx-auto'>
        <div className='w-full h-112'>
          <img src={howToStart} className='w-full h-full' />
        </div>
      </div>
      <div className='bg-red-550 my-16 w-full md:max-w-3xl lg:max-w-5.5xl mx-auto'>
        <div className='flex'>
          <AdvertiseMillionsCard />
          <AdvertiseMillionsCard />
          <AdvertiseMillionsCard />
        </div>
      </div>
    </>
  );
};
